
public class Addresss {
String area;
String city;
public Addresss() {
	super();
	// TODO Auto-generated constructor stub
}
public Addresss(String area, String city) {
	super();
	this.area = area;
	this.city = city;
}
public String getArea() {
	return area;
}
public void setArea(String area) {
	this.area = area;
}
public String getCity() {
	return city;
}
public void setCity(String city) {
	this.city = city;
}

}
